import React, { useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axios from 'axios';
import { useRecoilCallback, useRecoilState } from 'recoil';
import { productState } from '../../recoils/product';
import HeartIcon from '../../components/products/HeartIcon';

function ProductDetail() {
  const { id } = useParams();
  const navigate = useNavigate();
  const [product, setProduct] = useRecoilState(productState);

  const getProductRecoil = useRecoilCallback(({ set }) => async (id) => {
    try {
      const resp = await axios.get(`http://localhost:8000/products/${id}`);
      setProduct(resp.data.product);
    } catch (error) {
      console.error(error.message);
    }
  }, []);

  useEffect(() => {
    getProductRecoil(id);
  }, [getProductRecoil, id]);

  return (
    <main id="main">
      <div class="container-fluid page-header py-5">
        <h1 class="text-center text-white display-6">Shop Detail</h1>
        <ol class="breadcrumb justify-content-center mb-0">
          <li class="breadcrumb-item"><a href="/">Home</a></li>
          <li class="breadcrumb-item active text-white">Shop</li>
          <li class="breadcrumb-item"><a href="#">Sell</a></li>
        </ol>
      </div>

      <div class="container-fluid py-5 mt-10">
        <div class="container py-5">
          <div class="row justify-content-center">
            <div class="col-lg-8 col-xl-9">
              <div class="row g-12">
                <div class="col-lg-6">
                  <div class="border rounded">
                    <a href="#">
                      <img src={product.image} class="img-fluid rounded" alt={product.name} />
                    </a>
                  </div>
                </div>
                <div class="col-lg-6">
                  <h4 class="fw-bold mb-3">{product.name}</h4>
                  <p class="mb-3">Category: Vegetables</p>
                  <h5 class="fw-bold mb-3">{product.price}</h5>
                  <div class="d-flex mb-4">
                    <i class="fa fa-star text-secondary"></i>
                    <i class="fa fa-star text-secondary"></i>
                    <i class="fa fa-star text-secondary"></i>
                    <i class="fa fa-star text-secondary"></i>
                    <i class="fa fa-star"></i>
                  </div>
                  <p class="mb-4">{product.description}</p>
                  <p class="mb-4">Susp endisse ultricies nisi vel quam suscipit. Sabertooth peacock flounder; chain pickerel hatchetfish, pencilfish snailfish</p>
                  <div class="input-group quantity mb-5" style={{width: '100px'}}>
                    <div class="input-group-btn">
                      <button class="btn btn-sm btn-minus rounded-circle bg-light border">
                        <i class="fa fa-minus"></i>
                      </button>
                    </div>
                    <input type="text" class="form-control form-control-sm text-center border-0" value="1" />
                    <div class="input-group-btn">
                      <button class="btn btn-sm btn-plus rounded-circle bg-light border">
                        <i class="fa fa-plus"></i>
                      </button>
                    </div>
                  </div>
                  <a href="#" class="btn border border-secondary rounded-pill px-4 py-2 mb-4 text-primary">
                    <i class="me-2 text-primary"><HeartIcon /></i> 구입하기
                  </a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </main>
  );
}

export default ProductDetail;
